import React from 'react';
import { Link } from 'react-router-dom';
import { ListGroup, ListGroupItem } from 'reactstrap';

const Menus=()=>{
    return(
        <ListGroup>
            <Link className="list-group-item list-group-item-action" tag="a" to="/" action>Home</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="/add-admin" action>Register Admin</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="#!" action>Register Customer</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="#!" action>Register Worker</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="/view-admins" action>View Admins</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="#!" action>View Customers</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="#!" action>View Workers</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="#!" action>About</Link>
            <Link className="list-group-item list-group-item-action" tag="a" to="#!" action>Contact Us</Link>
        </ListGroup>
    )
}

export default Menus;
